const log = console.log;

export const viewPlace = (ctx, location) => {
    log(`Viewing ${location}...`);
    ctx.setState({
        locationViewed: location
    });
}

export class Location {
  constructor(name, maxOccupency, email, password, accountType, sex) {
    this.name = name;
    this.maxOccupency = maxOccupency;
    this.email = email;
    this.password = password;
    this.accountType = accountType;
    this.sex = sex;
    this.hash = this.email + this.password;
  }

  getHash = () => {
    return this.hash;
  };
}
